const getBlogEntries = () => {
    return fetch('http://localhost:9000/blogentries/')
    .then(res => res.json());
}

const createBlogEntry = entry => {
    return fetch(`http://localhost:9000/blogentries/new/${entry.title}-${entry.content}-${entry.img_link}`, {method: 'POST'})
    .then(res => res.json());
}

module.exports = {
    getBlogEntries,
    createBlogEntry
}
